import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <footer className="footer text-center py-3">
      <div className="container">
        <p className="mb-0">&copy; 2025 MSC Health. All rights reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
